import{_ as e,c as t,o as a,d as r}from"./app.e5528619.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"title: \u7A0B\u52AD\u975E\uFF08winter\uFF09-\u91CD\u5B66\u524D\u7AEF","slug":"title-\u7A0B\u52AD\u975E\uFF08winter\uFF09-\u91CD\u5B66\u524D\u7AEF","link":"#title-\u7A0B\u52AD\u975E\uFF08winter\uFF09-\u91CD\u5B66\u524D\u7AEF","children":[]},{"level":2,"title":"\u8FDB\u51FB\u5427\uFF0C\u56FE\u5F62\u5B66\uFF01","slug":"\u8FDB\u51FB\u5427\uFF0C\u56FE\u5F62\u5B66\uFF01","link":"#\u8FDB\u51FB\u5427\uFF0C\u56FE\u5F62\u5B66\uFF01","children":[]},{"level":2,"title":"\u5305\u7BA1\u7406\u7684\u6551\u8D4E","slug":"\u5305\u7BA1\u7406\u7684\u6551\u8D4E","link":"#\u5305\u7BA1\u7406\u7684\u6551\u8D4E","children":[]},{"level":2,"title":"\u667A\u80FD\u7814\u53D1\uFF0C\u524D\u7AEF\u6709\u8D23","slug":"\u667A\u80FD\u7814\u53D1\uFF0C\u524D\u7AEF\u6709\u8D23","link":"#\u667A\u80FD\u7814\u53D1\uFF0C\u524D\u7AEF\u6709\u8D23","children":[]}],"relativePath":"JavaScript/\u7A0B\u52AD\u975E\uFF08winter\uFF09-\u91CD\u5B66\u524D\u7AEF/\u65B0\u5E74\u5F69\u86CB-2019-\u6709\u54EA\u4E9B\u524D\u7AEF\u6280\u672F\u503C\u5F97\u5173\u6CE8.md"}'),i={name:"JavaScript/\u7A0B\u52AD\u975E\uFF08winter\uFF09-\u91CD\u5B66\u524D\u7AEF/\u65B0\u5E74\u5F69\u86CB-2019-\u6709\u54EA\u4E9B\u524D\u7AEF\u6280\u672F\u503C\u5F97\u5173\u6CE8.md"},p=r('<hr><h2 id="title-\u7A0B\u52AD\u975E\uFF08winter\uFF09-\u91CD\u5B66\u524D\u7AEF" tabindex="-1">title: \u7A0B\u52AD\u975E\uFF08winter\uFF09-\u91CD\u5B66\u524D\u7AEF <a class="header-anchor" href="#title-\u7A0B\u52AD\u975E\uFF08winter\uFF09-\u91CD\u5B66\u524D\u7AEF" aria-hidden="true">#</a></h2><p>\u65B0\u5E74\u5F69\u86CB | 2019\uFF0C\u6709\u54EA\u4E9B\u524D\u7AEF\u6280\u672F\u503C\u5F97\u5173\u6CE8\uFF1F</p><p>\u5927\u5BB6\u597D\uFF0C\u6211\u662Fwinter\uFF0C\u60F3\u501F\u8FD9\u4E2A\u673A\u4F1A\u8DDF\u5927\u5BB6\u804A\u4E00\u804A2019\u5E74\u524D\u7AEF\u4F1A\u53D1\u751F\u7684\u4E00\u4E9B\u4E8B\u60C5\u3002</p><p>\u9996\u5148\u5462\uFF0C\u6211\u89C9\u5F97\u53EF\u4EE5\u8C08\u4E00\u8C08\uFF0C\u6211\u7279\u522B\u5173\u6CE8\u7684\u56FE\u5F62\u5B66\u9886\u57DF\u3002</p><h2 id="\u8FDB\u51FB\u5427\uFF0C\u56FE\u5F62\u5B66\uFF01" tabindex="-1">\u8FDB\u51FB\u5427\uFF0C\u56FE\u5F62\u5B66\uFF01 <a class="header-anchor" href="#\u8FDB\u51FB\u5427\uFF0C\u56FE\u5F62\u5B66\uFF01" aria-hidden="true">#</a></h2><p>\u5728\u6DD8\u5B9D\u5DE5\u4F5C\u7684\u540E\u671F\uFF0C\u6211\u4E5F\u6709\u5F88\u5927\u4E00\u90E8\u5206\u7CBE\u529B\u653E\u5728\u4E86\u56FE\u5F62\u5B66\u4E0A\u9762\uFF0C\u6211\u662F\u6DF1\u523B\u5730\u611F\u89C9\u5230\uFF0C\u5728\u672A\u6765\uFF0C\u56FE\u5F62\u5B66\u4F1A\u548C\u524D\u7AEF\u7ED3\u5408\u7684\u66F4\u7D27\u5BC6\u3002\u8FD9\u662F\u7531\u4E8E\u6211\u89C9\u5F97\u56FE\u5F62\u5B9E\u9645\u4E0A\u662FUI\u6700\u91CD\u8981\u7684\u4E00\u90E8\u5206\u8BA1\u7B97\u673A\u79D1\u5B66\uFF0C\u540C\u65F6\u5B83\u4E5F\u662F\u8BA1\u7B97\u673A\u9886\u57DF\u91CC\u9762\u7684\u4E00\u4E2A\u975E\u5E38\u5173\u952E\u7684\u5B66\u79D1\u3002</p><p>\u6211\u4EEC\u7684\u524D\u7AEF\u5C31\u662F\u505AUI\u7684\u8FD9\u6837\u7684\u4E00\u4E2A\u804C\u80FD\uFF0C\u5728\u672A\u6765\uFF0C\u6211\u89C9\u5F97\u968F\u7740\u524D\u7AEF\u7684\u5DE5\u4F5C\u5C42\u7EA7\u9010\u6E10\u5730\u4E0B\u6C89\uFF0C\u524D\u7AEF\u80FD\u591F\u505A\u5230\u8D8A\u6765\u8D8A\u591A\u7684\u4E8B\u60C5\u3002\u6211\u4EEC\u7684\u56FE\u5F62\u4E5F\u4F1A\u9010\u6E10\u7684\u6210\u4E3A\u524D\u7AEF\u7684\u4E00\u4E2A\u57FA\u672C\u7684\u6280\u80FD\u3002</p><p>\u6211\u57282018\u5E74\u5DF2\u7ECF\u53EF\u4EE5\u770B\u5230\u5F88\u591A2D\u548C3D\u9886\u57DF\u7684\u5E94\u7528\u4E86\uFF0C\u6211\u4EEC\u4F1A\u75282D\u7684\u4E1C\u897F\u53BB\u505A\u56FE\u7247\u7684\u6E32\u67D3\uFF0C\u6211\u4EEC\u4F1A\u75283D\u7684\u4E1C\u897F\u53BB\u505A\u4E00\u4E9B3D\u573A\u666F\u7684\u5448\u73B0\uFF0C\u5728\u4E0D\u540C\u7684\u516C\u53F8\u6211\u90FD\u4F1A\u770B\u5230\u5F88\u591A\u8FD9\u6837\u7684\u6848\u4F8B\u3002</p><p>\u53E6\u5916\uFF0C\u6211\u89C9\u5F97\u56FE\u5F62\u5B66\u4E5F\u4F1A\u5927\u91CF\u5730\u5438\u6536\u4EE5\u524D\u5728PS\u4E2D\u7531\u8BBE\u8BA1\u5E08\u505A\u7684\u529F\u80FD\uFF0C\u5F88\u591A\u4EE5\u524D\u6211\u4EEC\u505A\u5F97\u8FD9\u79CD\u6548\u679C\uFF0C\u5305\u62EC\u534A\u900F\u660E\uFF0C\u5305\u62EC\u6A21\u7CCA\u7B49\u7B49\u90FD\u662F\u5728PS\u91CC\u9762\uFF0C\u7528\u56FE\u7247\u6765\u5B9E\u73B0\u7684\u3002</p><p>\u4F46\u6211\u8BA4\u4E3A\u5728\u672A\u6765\uFF0C\u968F\u7740\u56FE\u5F62\u5B66\u6280\u672F\u9010\u6E10\u5730\u53D1\u5C55\uFF0C\u524D\u7AEF\u53EF\u4EE5\u7528\u4EE3\u7801\u6765\u5B9E\u73B0\u8FD9\u6837\u7684\u6548\u679C\uFF0C\u8FD9\u6837\u6211\u4EEC\u5C31\u53EF\u4EE5\u4E0D\u7528\u8BBE\u8BA1\u5E08\u4EA7\u51FA\u7684\u56FE\u7247\u4E86\uFF0C\u800C\u662F\u8BBE\u8BA1\u5E08\u544A\u8BC9\u6211\u4EEC\u7528\u4EC0\u4E48\u6837\u7684\u6548\u679C\uFF0C\u6211\u4EEC\u6765\u5199\u4EE3\u7801\u628A\u5B83\u5B9E\u73B0\u3002</p><p>\u8FD9\u79CD\u4E0B\u6C89\u5176\u5B9E\u6709\u4E2A\u597D\u5904\uFF0C\u6211\u8BA4\u4E3A\u5F53\u524D\u7AEF\u5DE5\u4F5C\u5C42\u4E0B\u6C89\u5230\u4E00\u5B9A\u7684\u7A0B\u5EA6\uFF0C\u6211\u4EEC\u5C31\u4E0D\u4F1A\u6709\u201C\u505A\u4E0D\u51FA\u6765\u8FD9\u6837\u7684\u6548\u679C\u201D\u8FD9\u4EF6\u4E8B\u53D1\u751F\u4E86\u3002</p><p>\u8FD9\u4EF6\u4E8B\u662F\u5F88\u6709\u610F\u4E49\u7684\uFF0C\u4ECA\u5929\u4F60\u53BB\u95EE\u4E00\u4E2AC++\u7684\u5DE5\u7A0B\u5E08\uFF0C\u8FD9\u4E2A\u4E1C\u897F\u80FD\u4E0D\u80FD\u505A\uFF0C\u4ED6\u53EA\u4F1A\u8BF4\u8FD9\u4E2A\u4E1C\u897F\u6211\u4E0D\u80FD\u505A\uFF0C\u4ED6\u4E0D\u4F1A\u8BF4\uFF0CC++\u4E0D\u80FD\u505A\uFF0C\u90A3\u5728\u6211\u4EEC\u524D\u7AEF\u8FD9\u6837\u7684\u60C5\u51B5\u5F80\u5F80\u662F\u521A\u597D\u76F8\u53CD\u7684\uFF0C\u6240\u4EE5\u8BF4\uFF0C\u6211\u89C9\u5F97\u672A\u6765\u4E0B\u6C89\uFF0C\u6280\u672F\u4E0B\u6C89\u4F1A\u7ED9\u6211\u4EEC\u524D\u7AEF\u5E26\u6765\u66F4\u591A\u7684\u804C\u8D23\uFF0C\u4E5F\u540C\u65F6\u662F\u4E00\u79CD\u8D23\u4EFB\u3002</p><h2 id="\u5305\u7BA1\u7406\u7684\u6551\u8D4E" tabindex="-1">\u5305\u7BA1\u7406\u7684\u6551\u8D4E <a class="header-anchor" href="#\u5305\u7BA1\u7406\u7684\u6551\u8D4E" aria-hidden="true">#</a></h2><p>\u6211\u89C9\u5F97\u524D\u7AEF\u7B2C\u4E8C\u4E2A\u4F1A\u975E\u5E38\u91CD\u8981\u7684\u53D1\u5C55\u8D8B\u52BF\u5C31\u662F\uFF1A\u5305\u7BA1\u7406\u3002\u6211\u4EEC\u90FD\u77E5\u9053\uFF0CNPM\u662F\u4E00\u4E2A\u975E\u5E38\u597D\u7684\u5305\u7BA1\u7406\u3002</p><p>\u4F46\u662F\u5B9E\u9645\u4E0A\uFF0C\u6211\u4EEC\u7684NPM\u751F\u6001\u91CC\u4E5F\u6709\u5F88\u591A\u7684\u95EE\u9898\uFF0C\u5305\u62EC\u5B89\u5168\u95EE\u9898\uFF0C\u5305\u62EC\u4F9D\u8D56\u592A\u591A\u9020\u6210\u7684\u6027\u80FD\u95EE\u9898\u3002\u6211\u89C9\u5F97\u76EE\u524D\u5230\u4E86\u4E00\u4E2A\u91CD\u8981\u7684\u65F6\u95F4\u70B9\u4E86\uFF0C\u90A3\u4E48NPM\u7684\u8FD9\u79CD\u95EE\u9898\uFF0C\u4E00\u5B9A\u4F1A\u6709\u4EBA\u89E3\u51B3\u3002</p><p>\u4F46\u8FD9\u79CD\u89E3\u51B3\u65B9\u6848\uFF0C\u5230\u5E95\u662FNPM\u7684\u7ADE\u4E89\u5BF9\u624B\u4F1A\u4EA7\u751F\u4E00\u4E2A\u65B0\u7684\u8FD9\u6837\u7684\u5305\u7BA1\u7406\u7684\u5E73\u53F0\uFF1B\u8FD8\u662F\u6211\u4EEC\u7684NPM\u751F\u6001\u91CC\u9762\u8BDE\u751F\u4E00\u4E9B\u66F4\u597D\u7684\u65B9\u6848\uFF0C\u6700\u7EC8\u628A\u95EE\u9898\u89E3\u51B3\u5462\uFF1F\u8FD9\u4E2A\u5C31\u662F\u6211\u6CA1\u6709\u529E\u6CD5\u53BB\u9884\u6D4B\u7684\u4E8B\u60C5\u4E86\u3002</p><h2 id="\u667A\u80FD\u7814\u53D1\uFF0C\u524D\u7AEF\u6709\u8D23" tabindex="-1">\u667A\u80FD\u7814\u53D1\uFF0C\u524D\u7AEF\u6709\u8D23 <a class="header-anchor" href="#\u667A\u80FD\u7814\u53D1\uFF0C\u524D\u7AEF\u6709\u8D23" aria-hidden="true">#</a></h2><p>\u53E6\u4E00\u4E2A\u6280\u672F\u662F\u6211\u6BD4\u8F83\u5173\u6CE8\u7684\u662FAI\u9886\u57DF\u548C\u524D\u7AEF\u7684\u7ED3\u5408\uFF0C\u6211\u4EEC\u7684AI\u9886\u57DF\uFF0C\u4ECA\u5929\u867D\u7136\u7092\u5F97\u975E\u5E38\u706B\u70ED\uFF0C\u4F46\u662F\u5728\u6211\u770B\u6765\uFF0C\u771F\u6B63\u5E94\u7528\u7684\u6BD4\u8F83\u597D\u7684\u573A\u666F\uFF0C\u5C31\u662F\u89C6\u89C9\u548C\u63A8\u8350\u8FD9\u4E24\u4E2A\u9886\u57DF\u3002</p><p>\u6211\u89C9\u5F97\u667A\u80FD\u7814\u53D1\u7684\u9886\u57DF\u662F\u6574\u4E2A\u5B66\u672F\u754C\u975E\u5E38\u5C11\u5173\u6CE8\u7684\uFF0C\u90A3\u4E48\u6211\u4EEC\u7684\u524D\u7AEF\u5E94\u8BE5\u628A\u8FD9\u4E2A\u8D23\u4EFB\u80CC\u8D77\u6765\u3002</p><p>\u6211\u5728\u6DD8\u5B9D\u5DF2\u7ECF\u770B\u5230\u5F88\u591A\u8FD9\u4E2A\u65B9\u9762\u7684\u52AA\u529B\u4E86\uFF0C\u6211\u89C9\u5F97\u5728\u4E1A\u754C\uFF0C\u8FD9\u4E2A\u4E1C\u897F\u57282019\u5E74\u4EA7\u91CF\u5E94\u8BE5\u4E5F\u4F1A\u8D8A\u6765\u8D8A\u6210\u719F\uFF0C\u6BD5\u7ADF\u5207\u56FE\u5DE5\u4F5C\u662F\u4E00\u4E2A\u673A\u68B0\u6027\u7684\u52B3\u52A8\uFF0C\u673A\u68B0\u6027\u7684\u52B3\u52A8\u6700\u7EC8\u4E00\u5B9A\u4F1A\u88AB\u673A\u5668\u53D6\u4EE3\u3002</p><p>\u6240\u4EE5\uFF0C\u6211\u8BA4\u4E3A\u672A\u6765\uFF0C\u6211\u4EEC\u524D\u7AEF\u7684\u5DE5\u4F5C\u662F\u4E0D\u5E94\u8BE5\u5305\u542B\u5207\u56FE\u8FD9\u9879\u5DE5\u4F5C\u7684\u3002\u6211\u4E5F\u6BD4\u8F83\u671F\u5F85\u8FD9\u65B9\u9762\u80FD\u591F\u5C3D\u5FEB\u5730\u4EA7\u751F\u4E00\u4E9B\u6210\u7EE9\u3002</p><p>\u6700\u540E\u5462\uFF0C\u6211\u89C9\u5F97\u5176\u4ED6\u7684\u6280\u672F\u57282019\u5E74\uFF0C\u5E94\u8BE5\u4F1A\u662F\u4E00\u4E2A\u7A33\u5B9A\u53D1\u5C55\u7684\u72B6\u6001\uFF0C\u5305\u62EC\u5927\u5BB6\u7279\u522B\u5173\u5FC3\u7684\u4E09\u5927\u6846\u67B6\uFF0CVue\u3001Angular\u3001React\u3002\u6211\u8BA4\u4E3A\u5E94\u8BE5\u662F\u201C\u7EE7\u7EED\u7E41\u8363\u53D1\u5C55\uFF0C\u7EE7\u7EED\u7A33\u5B9A\u53D1\u5C55\uFF0C\u6700\u540E\u751F\u6001\u8D8A\u6765\u8D8A\u6210\u719F\u201D\u8FD9\u6837\u7684\u4E00\u4E2A\u72B6\u6001\u3002</p><p>\u4EE5\u4E0A\u5462\uFF0C\u5C31\u662F\u6211\u5BF92019\u5E74\u7684\u4E00\u4E9B\u9884\u6D4B\u548C\u9884\u671F\u4E86\u3002\u5F53\u7136\u4E86\uFF0C\u6211\u975E\u5E38\u5E0C\u671B\u6211\u4EEC\u4ECA\u5929\u4E2D\u56FD\u7684\u524D\u7AEF\u754C\u80FD\u591F\u8BDE\u751F\u4E00\u4E9B\u65B0\u7684\u60F3\u6CD5\uFF0C\u80FD\u591F\u8BA9\u6211\u5927\u5403\u4E00\u60CA\uFF0C\u751A\u81F3\u662F\u8BA9\u6211\u7684\u9884\u6D4B\u843D\u7A7A\uFF0C\u6211\u89C9\u5F97\u6211\u4E5F\u4F1A\u975E\u5E38\u9AD8\u5174\u7684\u3002</p><p>\u5728\u6700\u540E\uFF0C\u518D\u6B21\u795D\u5927\u5BB6\u65B0\u5E74\u5FEB\u4E50\u3002\u4F60\u5BF9\u524D\u7AEF\u7684\u53D1\u5C55\u6709\u4EC0\u4E48\u6837\u7684\u5224\u65AD\u548C\u9884\u6D4B\u5462\uFF0C\u6B22\u8FCE\u7ED9\u6211\u7559\u8A00\uFF0C\u6211\u4EEC\u4E00\u8D77\u8BA8\u8BBA\u3002</p><p><a href="https://time.geekbang.org/column/intro/154?utm_term=zeusL6497&amp;utm_source=app&amp;utm_medium=geektime&amp;utm_campaign=onsell&amp;utm_content=0212textlink" target="_blank" rel="noreferrer"><img src="https://static001.geekbang.org/resource/image/7c/b1/7ca7c24e92d25bde2e8609ed5386b5b1.jpg" alt="unpreview"></a></p>',26),n=[p];function l(_,c,d,s,h,o){return a(),t("div",null,n)}const g=e(i,[["render",l]]);export{u as __pageData,g as default};
